import React, { PureComponent } from 'react';
import Button from './Button';
import './LeftNav.scss';

interface Props {

}

class LeftNav extends PureComponent {
    render() {
        return (
            <div className='LeftNav'>
                <Button
                    label='Random Color'
                    link=''
                />
                Red
                <br />
                Orange
                <br />
                Yellow
                <br />
                Green
                <br />
                Blue
                <br />
                Purple
                <br />
                Brown
                <br />
                Gray
                <br />
            </div>
        )
    }
}

export default LeftNav;
